import React from 'react';
import TodoItem from './TodoItem';
import userData from '../userData.js'
const styles = {
    backgroundColor: '#AFEEEE'
}

function App() {
    const userComponents = userData.map(user => <TodoItem key={user.id} input={user.input} />)
    return(
        <div className='wrapper'>
            <h2>Todo List:</h2> 
            <ol style={styles}>
                {userComponents}
            </ol>
        </div>
    )
};

export default App;
